		var fullPhoneNumber= phoneCodeField.value+phoneField.value
		const intlCode1 = window.intlTelInput(phoneField, {

			countrySearch: true,
		});
		intlCode1.setNumber(fullPhoneNumber );
		const initialCountryCode = intlCode1.getSelectedCountryData().dialCode;
		phoneCodeField.value = "+" + initialCountryCode;
		phoneField.addEventListener('countrychange', () => {
			const countryCodeData = intlCode1.getSelectedCountryData();
			const countryCoding = countryCodeData ? countryCodeData.dialCode : intlCode1.defaultCountry;
			phoneField.value = ""
			phoneCodeField.value = "+" + countryCoding;
			validatePhoneNumber(intlCode1, phoneField, errorMessageValidation);
		});
		phoneField.addEventListener('change', () => validatePhoneNumber(intlCode1, phoneField, errorMessageValidation));
		phoneField.addEventListener('input', () => validatePhoneNumber(intlCode1, phoneField, errorMessageValidation));
		phoneField.addEventListener('paste', () => {
			setTimeout(() => validatePhoneNumber(intlCode1, phoneField, errorMessageValidation));
		});
		phoneField.dispatchEvent(new Event("input"))
		$("#contactNumber").val(removeAlphaSymbolCharacter(phoneField.value));
		let intlCode2;

			var fullPhoneNumber1= phoneCodeField1.value+phoneField1.value
			intlCode2 =window.intlTelInput(phoneField1, {

			intlCode2.setNumber(fullPhoneNumber1 );

				phoneField1.value=""

			phoneField1.addEventListener('change', () => validatePhoneNumber(intlCode2, phoneField1, errorMessageValidation1));

				setTimeout(() => validatePhoneNumber(intlCode2, phoneField1, errorMessageValidation1));

			phoneField1.dispatchEvent(new Event("input"))
			$("#landlineNo").val(removeAlphaSymbolCharacter(phoneField1.value));

///////////////////////////// Leading zero //////////////////////////////
